help = "Update_ID(Actualizar ID) actualiza el valor de un elemento de colecci\u00F3n cuyo id es igual al especificado \n\
Execute_script (Execute script) lee y ejecuta el script desde el archivo especificado. El script contiene comandos en la misma forma en que el usuario los ingresa en modo interactivo. \n\
Show (Show) env\u00EDa al flujo de salida est\u00E1ndar todos los elementos de la colecci\u00F3n en una representaci\u00F3n de cadena \n\
Clear(Borrar) borrar la colecci\u00F3n \n\
Remove_any_by_unit_of_measure(Eliminar cualquier por unidad de medida) elimina un elemento de la colecci\u00F3n, cuyo valor del campo UnitOfMeasure es equivalente al especificado \n\
History(Historial) genera los \u00FAltimos 10 comandos (sin sus argumentos) \n\
Remove_Lower (Remove_Lower) elimina de la colecci\u00F3n todos los elementos m\u00E1s peque\u00F1os que el especificado \n\
Help (Help) ayuda de salida para los comandos disponibles \n\
Exit (Salir) terminar el programa (sin guardar en un archivo) \n\
Remove_Lower_Key (Eliminar clave inferior) elimina de la colecci\u00F3n todos los elementos cuya clave es menor que la especificada \n\
Average_of_manufacture_cost(Promedio del costo de fabricaci\u00F3n ) genera el valor promedio del campo manurecost para todos los elementos de la colecci\u00F3n \n\
Insert_Null(Insert Null) agrega un nuevo elemento con la clave especificada \n\
Remove_Key (Eliminar clave) eliminar un elemento de la colecci\u00F3n por su clave \n\
Group_counting_by_price(Agrupe los elementos de la colecci\u00F3n por el valor del campo precio, genere el n\u00FAmero de elementos en cada grupo\n\
Info (Info) env\u00EDa al flujo de salida est\u00E1ndar informaci\u00F3n sobre la colecci\u00F3n (tipo, fecha de inicializaci\u00F3n, n\u00FAmero de elementos, etc.)"
